import React, { useState, useEffect } from "react";
import { View, Text } from "react-native";

export default function TodoScreen() {

    const getData = () => {
        console.log('hello axios')
    }

    useEffect(() => {
      console.log('effect')
    },)

    return(
        <View>
            <Text>User Screen</Text>
        </View>
    )
}
